export default {
    data() {
        return {
            title: '应用申请',
            editPage: false,
            object: {
                appName: '',
                appCode: '',
                description: '',
                status: '',
                appKey: '',
                appSecret: '',
            },
            appCode: '',
        }
    },
    created() { 
        this.editPage = this.$route.name === '应用编辑' ? true : false
        if(this.editPage) {
            this.title = '应用编辑'
        }
    },
    mounted() {
        this.appCode = this.$route.query.appCode ? this.$route.query.appCode : ''
        if(this.$route.name === '应用编辑' || this.$route.name === '应用详情') {
            this.$api.viewAppDetail({
                appCode: this.appCode
            }).then(res => {
                console.log(res,'yyyy');
                this.object = res.data
            })
        }
    },
    methods: {
        // 重置
        reset() {
            console.log('重置');
            this.object = {}
        },
        // 提交申请
        submitApplication() {
            console.log('提交申请');
            console.log(this.object);
            this.$api.applyForApp(this.object).then(res=>{
                console.log(res);
                this.$message.success('申请成功!')
            })
        },
        // 确认更新
        confirmModify() {
            console.log('确定修改');
            console.log(this.object);
            this.$api.updateApp(this.object).then(res=>{
                console.log(res);
                this.$message.success('更新成功!')
            })
        }
    }
}
